import React, { Component } from "react";

export class home extends Component {
  render() {
    return (
      <div style={{ background: "grey" }}>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "10rem",
            fontSize: 32,
            background: "grey",
          }}
        >
          Welcome to ReFinance
        </div>
      </div>
    );
  }
}

export default home;
